  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;The high-permittivity substrate
  (er = 10.2) allows individual antenna patches to be made smaller and also mimics
  substrates (Si, SiC, GaAs, InP, GaN) used in MMIC and OEIC technology. If successful,
  the antennas may be integrated together with receiver components on the same substrate
  for miniaturization. Another important benefit is that surface waves are inhibited
  so that devices on the same substrate are isolated from each other.&lt;/p&gt;\",\n\t\"license_title\":
